<!DOCTYPE html>
<html>
<head lang="en">
    <meta charset="UTF-8">
    <title></title>
</head>
<body>

</body>
<script src="assets/jquery-2.1.3.min.js"></script>
<script>
    var html='';
    var startArray=[132,230,326,490,603,691,864,960,1056];
    var endArray=[230,242,337,518,613,699,880,965,1062];
    var positionArray=[
        '[0.35, 0.23]',
        '[0.79, 0.74]',
        '0.2, 0.6]',
        '[0.15, 0.26]',
        '[0.8, 0.5]',
        '[0.34, 0.88]',
        '[0.81, 0.81]',
        '[0.61, 0.24]',
        '[0.15, 0.26]'
    ];

    var html='';

    function print(start,end,position){
        for(var i=start;i<=end;i++){
            html=html+'"'+i+'"'+':'+position+',<br>';
        }
    }

    var border=0;
    for(var i=0;i<9;i++){
        var position=positionArray[i];
        if(i%3==0){
            border=i;
        }
        for(var j=border;j<border+3;j++){
            var start=startArray[j];
            var end=endArray[j];
            print(start,end,position);
        }
        html=html+'<br>';
    }

    $('body').html(html);
</script>
</html>
